import React from 'react';
import Itens from './Itens';

const Listavideos = ({videos}) => {
	console.log(videos)
	//const listaDeVideos = videos.map(  (video, id) => <Itens key={id} video={video}/> )
	return console.log(videos) //listaDeVideos;
		
};

export default Listavideos;
